import cardLogo from "../images/card-logo.svg";

const CardDetails = (props) => {
  return (
    <div className="front-of-card-text-container">
      <img className="card-logo" src={cardLogo} alt="credit card logo" />
      <p className="sample-card-number">{props.cardNumber}</p>
      <div className="card-bottom-row">
        <p className="sample-card-holder">{props.cardHolder}</p>
        <p className="sample-expiration">{props.expiration}</p>
      </div>
    </div>
  );
};

export default CardDetails;
